                                    <value index=\"vDEF\">Responsive Design</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Being responsive by default, but takes responsive design a step further by giving you complete control over every design setting on each mobile device.&amp;nbsp;&lt;/p&gt;</value>\n                                    </field>\n                                    <field index=\"twitter\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                    <field index=\"facebook\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                    <field index=\"linkedin\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"61b20a2843c44782415561\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"check\">\n                                        <value index=\"vDEF\">0</value>\n                                    </field>\n                                    <field index=\"icon\">\n                                        <value index=\"vDEF\">fa-lock</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Scalable</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Super customizable TYPO3 theme with many predesigned concepts to kick things off quickly and effortlessly.&amp;nbsp;&lt;/p&gt;</value>\n                                    </field>\n                                    <field index=\"twitter\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                    <field index=\"facebook\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                    <field index=\"linkedin\">\n                                        <value index=\"vDEF\"></value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                    </el>\n                </field>\n                <field index=\"otherText\">\n                    <value index=\"vDEF\"></value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>', '', '', '', 124, 0, 0, 0, 0, '0', 0, 1),
(2, '', 13, 1688725496, 1688725496, 0, 0, 0, 0, '', 256, 0, 0, 0, 0, '', 0x7b2270695f666c6578666f726d223a22227d, 0, 0, 0, 0, 'ns_portfolio', '', '', '', 0, 0, 0, 0, 0, 0, 0, 2, 0, 0, 0, 'default', 0, '', '', '', '', 0, '', '', 0, '0', '', 1, 0, '', 0, '', '', '', 0, 0, '<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"title\">\n                    <value index=\"vDEF\">Portfolio</value>\n                </field>\n                <field index=\"subtitle\">\n                    <value index=\"vDEF\">Showcasing how this theme is a perfect match for you.</value>\n                </field>\n                <field index=\"portfolio\">\n                    <el index=\"el\">\n                        <field index=\"5da41cae9c759759569689\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">13</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Threads</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Illustration</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;The fashion industry&amp;nbsp;is always looking for the latest trends to soak up, reinterpret, and then relaunch in its own way to the rest of the world. This behaviour is also common in web design. So, when the worlds of fashion and Internet collide, we can expect to see websites that blend together&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da41ccd5d209937048064\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">14</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Explore</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Graphic Design</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Web graphic designers&amp;nbsp;decide how websites look, making choices about layout, fonts, and images to create usable and aesthetically pleasing websites. They may also work on individual page elements, such as logos or images, that are incorporated into the final&amp;nbsp;design.&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da41cdc2983e716922037\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">15</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Finish</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Identity</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Build your online hardware store and start selling your products such as&amp;nbsp;grills,&amp;nbsp;hardware, home improvement, lawn and garden, and tools. Buy&amp;nbsp;online&amp;nbsp;&amp;amp; pickup today!&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da41ceeb1539005833571\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">16</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Lines</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Branding</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Do you want to learn how design, branding, and marketing can make your new website or your blog stand out from the rest? If you do, then build your website now.&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da41cfdd797d297158821\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">17</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Southwest</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Website Design</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Whatever kind of a tech business or startup you are, you can take all these modern and responsive technology website templates to your advantage. For apps, software and any type of service you offer, it should not be a question anymore whether or not you need a website.&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da41d1488916035354027\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">18</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">Window</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Photography</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;A good photography website is a showcase for photos. Take inspiration from real-world photo galleries— your website should be uncluttered and have plenty of whitespace to frame your photos.&lt;/p&gt;\n&lt;ul class=&quot;list-inline&quot;&gt; 	&lt;li&gt;Date: January 2017&lt;/li&gt; 	&lt;li&gt;Client: Explore&lt;/li&gt; 	&lt;li&gt;Category: Graphic Design&lt;/li&gt; &lt;/ul&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                    </el>\n                </field>\n                <field index=\"check\">\n                    <value index=\"vDEF\">1</value>\n                </field>\n            </language>\n        </sheet>\n    </data>\n</T3FlexForms>', '', '', '', 124, 0, 0, 0, 0, '0', 0, 2),
(3, '', 12, 1688725496, 1688725496, 0, 0, 0, 0, '', 256, 0, 0, 0, 0, '', 0x7b2270695f666c6578666f726d223a22227d, 0, 0, 0, 0, 'ns_about', '', '', '', 0, 0, 0, 0, 0, 0, 0, 2, 0, 0, 0, 'default', 0, '', '', '', '', 0, '', '', 0, '0', '', 1, 0, '', 0, '', '', '', 0, 0, '<?xml version=\"1.0\" encoding=\"utf-8\" standalone=\"yes\" ?>\n<T3FlexForms>\n    <data>\n        <sheet index=\"sDEF\">\n            <language index=\"lDEF\">\n                <field index=\"gallery\">\n                    <el index=\"el\">\n                        <field index=\"5da1c6026795a160689796\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">9</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">2009-2011</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Our Humble Beginnings</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Just from setting up a small firm, we wanted to achieve something big. With deep determination and knowledge we delivered excellent services to our clients.&lt;/p&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da1c712575d7354050574\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">10</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">March 2011</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">An Agency is Born</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Just after span of 4 years we\'ve developed different web&amp;nbsp;services across state&amp;nbsp;with wide range of services and technical expertise&amp;nbsp;to&amp;nbsp;offer to our clients.&lt;/p&gt;</value>\n                                    </field>\n                                </el>\n                            </value>\n                            <value index=\"_TOGGLE\">1</value>\n                        </field>\n                        <field index=\"5da1c71eac33e106834980\">\n                            <value index=\"container\">\n                                <el>\n                                    <field index=\"image\">\n                                        <value index=\"vDEF\">11</value>\n                                    </field>\n                                    <field index=\"title\">\n                                        <value index=\"vDEF\">December 2012</value>\n                                    </field>\n                                    <field index=\"subtitle\">\n                                        <value index=\"vDEF\">Transition to Full Service</value>\n                                    </field>\n                                    <field index=\"text\">\n                                        <value index=\"vDEF\">&lt;p&gt;Soon we were officially branded and certified by various techn